CREATE TABLE users(
	id SERIAL PRIMARY KEY,
	name VARCHAR(100) NOT NULL,
	email VARCHAR(50) UNIQUE NOT NULL,
	google_id VARCHAR(50) UNIQUE NOT NULL,
	user_type VARCHAR(50) NOT NULL
);

CREATE TABLE session (
    id SERIAL PRIMARY KEY,
    user_id INT REFERENCES users(id) ON DELETE CASCADE,
    session_token VARCHAR(255) UNIQUE NOT NULL,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    expires_at TIMESTAMP
);

CREATE TABLE player(
	id SERIAL PRIMARY KEY,
	nickname VARCHAR(50) NOT NULL,
	user_id INTEGER REFERENCES users(id)
);

CREATE TABLE game_type(
	id SERIAL PRIMARY KEY,
	name VARCHAR(50) NOT NULL,
	location_type VARCHAR(50) NOT NULL,
	interaction_type VARCHAR(50) NOT NULL,
	feature_type VARCHAR(50),
	is_sequential BOOLEAN NOT NULL,
	label_hr VARCHAR(50),
	label_en VARCHAR(50),
	is_active BOOLEAN NOT NULL
);

CREATE TABLE time_limit_type(
	id SERIAL PRIMARY KEY,
	name VARCHAR(50) NOT NULL,
	label_hr VARCHAR(50),
	label_en VARCHAR(50),
	is_default BOOLEAN NOT NULL,
	is_active BOOLEAN NOT NULL
);

CREATE TABLE game_type_time_limit_type(
	id SERIAL PRIMARY KEY,
	game_type_id INT REFERENCES game_type(id) NOT NULL,
	time_limit_type_id INT REFERENCES time_limit_type(id) NOT NULL
);

CREATE TABLE scoring_type(
	id SERIAL PRIMARY KEY,
	name VARCHAR(50) NOT NULL,
	formula VARCHAR(1000) NOT NULL,
	max_score REAL NOT NULL,
	label_hr VARCHAR(50),
	label_en VARCHAR(50),
	is_active BOOLEAN NOT NULL
);

CREATE TABLE game_type_scoring_type(
	id SERIAL PRIMARY KEY,
	game_type_id INT REFERENCES game_type(id) NOT NULL,
	scoring_type_id INT REFERENCES scoring_type(id) NOT NULL
);

CREATE TABLE location(
	id SERIAL PRIMARY KEY,
	name VARCHAR(50) NOT NULL,
	type VARCHAR(50) NOT NULL,
	label_hr VARCHAR(50),
	label_en VARCHAR(50),
	is_custom BOOLEAN NOT NULL DEFAULT false,
	created_by INT REFERENCES users(id)
);

CREATE TABLE country(
	location_id INT REFERENCES location(id) PRIMARY KEY,
	country_code CHAR(3) NOT NULL,
	land_and_water_coordinates VARCHAR(10000000) NOT NULL
);

CREATE TABLE city(
	location_id INT REFERENCES location(id) PRIMARY KEY,
	latitude NUMERIC(8,5) NOT NULL,
	longitude NUMERIC(8,5) NOT NULL,
	country INT REFERENCES country(location_id) NOT NULL
);

CREATE TABLE region(
	id SERIAL PRIMARY KEY,
	name VARCHAR(50) NOT NULL,
	start_latitude NUMERIC(8,5) NOT NULL,
	start_longitude NUMERIC(8,5) NOT NULL,
	start_zoom SMALLINT NOT NULL,
	max_distance INT NOT NULL,
	label_hr VARCHAR(50),
	label_en VARCHAR(50),
	is_active BOOLEAN NOT NULL
);

CREATE TABLE region_location(
	id SERIAL PRIMARY KEY,
	location_id INT REFERENCES location(id),
	region_id INT REFERENCES region(id)
);

CREATE TABLE game(
	id CHAR(5) PRIMARY KEY,
	name VARCHAR(50),
	created_by INT REFERENCES users(id),
	type INT REFERENCES game_type(id) NOT NULL,
	scoring_type INT REFERENCES scoring_type(id) NOT NULL,
	region INT REFERENCES region(id) NOT NULL,
	number_of_rounds INT NOT NULL,
	time_limit_seconds INT,
	time_limit_type INT REFERENCES time_limit_type(id) NOT NULL,
	allow_skip BOOLEAN NOT NULL DEFAULT false,
	allow_retry BOOLEAN NOT NULL DEFAULT false,
	is_finished BOOLEAN NOT NULL DEFAULT false
);

CREATE TABLE game_location(
	id SERIAL PRIMARY KEY,
	game_id CHAR(5) REFERENCES game(id),
	location_id INT REFERENCES location(id)
);

CREATE TABLE player_game(
	id SERIAL PRIMARY KEY,
	player_id INT REFERENCES player(id),
	game_id CHAR(5) REFERENCES game(id),
	rounds_completed INT NOT NULL DEFAULT 0,
	time_left INT,
	total_score REAL NOT NULL DEFAULT 0,
	status VARCHAR(50) DEFAULT 'Not Started'
);

CREATE TABLE round(
	id SERIAL PRIMARY KEY,
	player_game_id INT REFERENCES player_game(Id) NOT NULL,
	location_id INT REFERENCES location(Id) NOT NULL,
	round_number SMALLINT NOT NULL,
	time_left INT,
	score REAL
);


